import { Component } from '@angular/core';

@Component({
  selector: 'app-khutbah',
  templateUrl: './khutbah.component.html',
  styleUrls: ['./khutbah.component.css']
})
export class KhutbahComponent {

  constructor(
    private route: Router,
  ){}

  backToMenu(){
    this.route.navigate(['setting']);
  }

}
